    false,nt"url": null,nt"notes": "This data layer (PAC_CLC.txt) is one of
    five point coverages of known sediment samples, inspections, and probes from the
    usSEABED data collection for the U.S Pacific continental margin integrated using
    the software system dbSEABED. This data layer represents the calculated (CLC) output
    of the dbSEABED mining software. Data in this file extend variables determined through
    the data extraction (EXT) and data parsing (PRS) processes of dbSEABED, calculated
    using empirical relations or known functions. The CLC data is the most derivative
    and least accurate of the usSEABED data files and should be used with caution; however,
    many users may appreciate that it extends the coverage of map areas with attributes,
    especially physical properties attributes. Please refer to the dbSEABED page (http://pubs.usgs.gov/ds/2006/182/dbseabed.html),
    and the Frequently Asked Questions (http://pubs.usgs.gov/ds/2006/182/faq.html) pages
    for more information on the calculation process. This file contains the same data
    fields as the extracted (PAC_EXT) and parsed (PAC_PRS) data files, and the three
    files may be combined.",nt"license_title": null,nt"extras": [{ntt"key":
